import React from 'react';

const Accessories = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-3xl font-bold mb-4">Accessories</h1>
            <p className="text-lg">
                Explore our wide range of accessories that complement your style and enhance your look. 
                From bags to jewelry, we have something for everyone!
            </p>
            {/* Add more content related to accessories here */}
        </div>
    );
};

export default Accessories;
